re&gt;\ndef main():\n    client = Client(n_workers=10, threads_per_worker=1)\n    print(client)\n\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.time()\n            anom_mean.compute()\n            stop = time.time()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"axis":{"id":"1118"},"ticker":null,"visible":false},"id":"1121","type":"Grid"},{"attributes":{},"id":"1243","type":"BasicTickFormatter"},{"attributes":{"source":{"id":"1001"}},"id":"1033","type":"CDSView"},{"attributes":{"dimensions":"width"},"id":"1021","type":"WheelZoomTool"},{"attributes":{},"id":"1188","type":"CategoricalScale"},{"attributes":{},"id":"1261","type":"YearsTicker"},{"attributes":{"factors":["a","b"]},"id":"1152","type":"FactorRange"},{"attributes":{},"id":"1241","type":"BasicTickFormatter"},{"attributes":{"formatter":{"id":"1249"},"ticker":{"id":"1195"}},"id":"1194","type":"CategoricalAxis"},{"attributes":{"formatter":{"id":"1203"},"major_label_orientation":-0.5,"minor_tick_line_alpha":0,"ticker":{"id":"1205"}},"id":"1190","type":"LinearAxis"},{"attributes":{"axis":{"id":"1122"},"dimension":1,"ticker":null},"id":"1125","type":"Grid"},{"attributes":{"format":"0.0 b"},"id":"1171","type":"NumeralTickFormatter"},{"attributes":{"axis":{"id":"1190"},"ticker":null},"id":"1193","type":"Grid"},{"attributes":{"axis":{"id":"1015"},"dimension":1,"ticker":null,"visible":false},"id":"1018","type":"Grid"},{"attributes":{"data_source":{"id":"1106"},"glyph":{"id":"1128"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1131"}},"id":"1130","type":"GlyphRenderer"},{"attributes":{"data_source":{"id":"1036"},"glyph":{"id":"1065"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1068"}},"id":"1067","type":"GlyphRenderer"},{"attributes":{},"id":"1016","type":"BasicTick
